import { useToggle } from '../Hooks/useToggle'

function Toggleing() {


    const [ isShow , toggle ] = useToggle();

  return (
    <div>

    <button onClick={ toggle }>
        {
            isShow? "Hide" : "Show"
        }
      </button>
       { isShow && <h1></h1> } 
    </div>
  )
}

export default Toggleing
